import React from "react";
import { withRouter} from 'react-router-dom';
import ReactTable from 'react-table'
import MUIDataTable from "mui-datatables";

class Searchtable extends React.Component {
render(){

    const data = [
        ["Reb1", "13.2", "153682", "154340","1.00"],
        ["Rvb1", "9.1", "7831", "17901","0.44"],
       ];
       const options = {
        filterType: false,
      };

      const columns = ["proteins", "z-score", "protein peak tags in this topic", "total protein peak tags","fraction of peak tags in this topic"];


      return (
        <div>
            <MUIDataTable
              data={data}
              columns={columns}
              options={options} 
            />
        </div>      
  )
}
}
export default withRouter(Searchtable);
